window.bookSummaryJSON = "<p><b>Eve had one job: kill Adam.</b></p> <p>But when her mark for the night turns out to be a gift-wrapped omega, Eve can’t resist delaying the job and enjoying the opportunity before her. One bite is all it takes.</p> <p>That’s what Adam is counting on. One bite, and he might live till morning. Success is complicated, and on the run for their lives, Eve and Adam need the one thing neither of them wants: a pack.</p> <p>Can three good men tame the killer and the con artist? Not if this bad alpha can help it.</p> <p><b>Warning: </b><b><i>Bad Alpha</i></b><b> is a MMFMM romance stand-alone with an HEA, set in the Sweetverse. Contains violence and the acts of a dangerous woman in command.</b></p>"; 
